import React, { Component } from 'react';
import '../../scss/Works.scss';
import ScrollAnimation from 'react-animate-on-scroll';
import Project from './Project/Project';
// import Chips from './Chips/Chips';
import firstImg from '../../img/restoImg.jpg';
import secondImg from '../../img/td2Img.jpg';
import thirdImg from '../../img/allezcineImg.jpg';
import fourthImg from '../../img/hitmanImg.jpg';

const Style = {
    puces: {
        color: 'rgb(241, 240, 179)',
        marginRight: 25
    },
    internet: {
        color: 'rgb(109, 195, 221)',
        marginLeft: 25
    }
};

export default class Works extends Component {
    render() {
        return (
            <article className="Works" id="myWorks">
                <ScrollAnimation animateIn="bounceInLeft">
                    <Project 
                        imgUrl={firstImg} style={Style.puce}
                    />
                </ScrollAnimation>

                <ScrollAnimation animateIn="bounceInRight">
                    <Project 
                        imgUrl={secondImg}
                    />
                </ScrollAnimation>

                <ScrollAnimation animateIn="bounceInLeft">
                    <Project 
                        imgUrl={thirdImg}
                    />
                </ScrollAnimation>

                <ScrollAnimation animateIn="bounceInRight">
                    <Project 
                        imgUrl={fourthImg}
                    />
                </ScrollAnimation>

                <ScrollAnimation animateIn="wobble" initiallyVisible={true}>
                    <p>Cette section sera régulièrement mise à jour</p>
                </ScrollAnimation>
            </article>
        );
    }
}
